import React, { useState } from "react";
import Link from "next/link";
import Container from "../../other/Container";
import { Drawer } from "antd";
import { CloseOutlined } from "@ant-design/icons";
import MenuSidebar from "./MenuSidebar";


function Navbar({ containerType }) {

    const [menuSidebarOpen, setMenuSidebarOpen] = useState(true);
    return (
        <div className="nav-menu">
            <Container type={containerType}>
                <div className="menu-wrapper">
                    <div className="">
                        <a
                            href="#"
                            className="menu-sidebar-opener"
                            onClick={(e) => {
                                e.preventDefault();
                                setMenuSidebarOpen(true);
                            }}
                        >
                            <div></div>
                            <div></div>
                            <div></div>
                        </a>
                    </div>
                    <div className="menu-functions">
                        <div className="menu-function-item">
                            <Link href={process.env.PUBLIC_URL + "/delivery"}>
                                <h3>Delivery</h3>
                            </Link>
                        </div>
                        <div className="menu-function-item">
                            <Link href={process.env.PUBLIC_URL + "/help"}>
                                <h3>Help</h3>
                            </Link>
                        </div>
                        <div className="menu-function-item">
                            <Link href={process.env.PUBLIC_URL + "/mode"}>
                                <h3>Mode</h3>
                            </Link>
                        </div>
                    </div>
                    <Drawer
                        placement="right"
                        closable={true}
                        title=" "
                        onClose={() => setMenuSidebarOpen(false)}
                        closeIcon={
                            <>
                                <p>Close</p> <CloseOutlined />
                            </>
                        }
                        visible={menuSidebarOpen}
                        width={350}
                        className="menu-side"
                    >
                        <MenuSidebar />
                    </Drawer>
                </div>
            </Container>
        </div>
    );
};

export default Navbar;
